// TrackAndUpdateComponent.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import API_URL from './constants';


function TrackAndUpdateComponent() {
  const [data, setData] = useState([]);
  const [filter, setFilter] = useState('');

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.post(`${API_URL}/track`, {
        filter: filter,
      });
      setData(response.data);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const handleFilterChange = (e) => {
    setFilter(e.target.value);
  };

  const handleFilterSubmit = () => {
    fetchData();
  };

  return (
    <div>
      <div>
        <label htmlFor="filterInput">Filter:</label>
        <input
          type="text"
          id="filterInput"
          value={filter}
          onChange={handleFilterChange}
        />
        <button onClick={handleFilterSubmit}>Submit</button>
      </div>

      <div>
        <h2>Filtered Data:</h2>
        <table>
          <thead>
            <tr>
              {/* Add table headers based on your data fields */}
              <th>Orig. Submit Date</th>
              {/* Add more headers as needed */}
            </tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr key={item.id}>
                <td>{item.OrigSubmitDate}</td>
                {/* Add more table cells as needed */}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default TrackAndUpdateComponent;
